/* CREATION DE LA BASE DE DONNEES */

drop database if exists dzFoot;
create database dzFoot;
alter database dzFoot charset=utf8;
use DZFoot;

Create table Wilaya 
	(
		Code smallint primary key check(code>0 AND code<=48),
		Designation varchar(30) unique
	);

Create table Equipe 
	(
		Sigle varchar(8) primary key,
		NomEqp varchar(50) unique,
		Couleurs varchar(30),
		Wilaya smallint not null references Wilaya (Code)
	);

Create table Joueur 
	(
		Numero smallint check(numero>0 AND numero<101),
		Nom varchar(50),
		Equipe varchar(8) not null references Equipe (Sigle),
		primary key (Numero,Equipe)
	);

Create table Stade 
	(
		ID int primary key,
		NomStade varchar(50),
		Wilaya smallint not null,
		foreign key (Wilaya) references Wilaya (Code) 
	);

Create table Rencontre 
	(
		NumeroRencontre int primary key,
		EquipeA varchar(8) not null references Equipe (Sigle),
		ButsEquipeA smallint check (ButsEquipeA >= 0),
		ButsEquipeB smallint check (ButsEquipeB >= 0),
		EquipeB varchar(8) not null references Equipe (Sigle),
		Stade int not null references Stade (ID),
		DateRencontre DATETIME not null
	);

Create table Marquer 
	(
		Rencontre int references Rencontre (NumeroRencontre),
		Equipe varchar(8) references Joueur(Equipe),
		NumeroJoueur int references Joueur (Numero),
		MinuteBut int check (MinuteBut >= 0),
		primary key (Rencontre,Equipe,NumeroJoueur,MinuteBut)
	);
delimiter ; 


